// VPSServiceHandler is an implementation of the obiente.cloud.vps.v1.VPSService service.
type VPSServiceHandler interface {
	// List organization VPS instances
	ListVPS(context.Context, *connect.Request[v1.ListVPSRequest]) (*connect.Response[v1.ListVPSResponse], error)
	// Create new VPS instance
	CreateVPS(context.Context, *connect.Request[v1.CreateVPSRequest]) (*connect.Response[v1.CreateVPSResponse], error)
	// Get VPS instance details
	GetVPS(context.Context, *connect.Request[v1.GetVPSRequest]) (*connect.Response[v1.GetVPSResponse], error)
	// Update VPS instance configuration
	UpdateVPS(context.Context, *connect.Request[v1.UpdateVPSRequest]) (*connect.Response[v1.UpdateVPSResponse], error)
	// Delete VPS instance
	DeleteVPS(context.Context, *connect.Request[v1.DeleteVPSRequest]) (*connect.Response[v1.DeleteVPSResponse], error)
	// Start a stopped VPS instance
	StartVPS(context.Context, *connect.Request[v1.StartVPSRequest]) (*connect.Response[v1.StartVPSResponse], error)
	// Stop a running VPS instance
	StopVPS(context.Context, *connect.Request[v1.StopVPSRequest]) (*connect.Response[v1.StopVPSResponse], error)
	// Reboot a VPS instance
	RebootVPS(context.Context, *connect.Request[v1.RebootVPSRequest]) (*connect.Response[v1.RebootVPSResponse], error)
	// Stream VPS status updates
	StreamVPSStatus(context.Context, *connect.Request[v1.StreamVPSStatusRequest], *connect.ServerStream[v1.VPSStatusUpdate]) error
	// Get VPS instance metrics (real-time or historical)
	GetVPSMetrics(context.Context, *connect.Request[v1.GetVPSMetricsRequest]) (*connect.Response[v1.GetVPSMetricsResponse], error)
	// Stream real-time VPS metrics
	StreamVPSMetrics(context.Context, *connect.Request[v1.StreamVPSMetricsRequest], *connect.ServerStream[v1.VPSMetric]) error
	// Get aggregated usage for a VPS instance
	GetVPSUsage(context.Context, *connect.Request[v1.GetVPSUsageRequest]) (*connect.Response[v1.GetVPSUsageResponse], error)
	// Get available VPS sizes/pricing
	ListVPSSizes(context.Context, *connect.Request[v1.ListAvailableVPSSizesRequest]) (*connect.Response[v1.ListAvailableVPSSizesResponse], error)
	// Get available VPS regions/locations
	ListVPSRegions(context.Context, *connect.Request[v1.ListVPSRegionsRequest]) (*connect.Response[v1.ListVPSRegionsResponse], error)
	// Get VPS proxy connection info (for accessing VPS without dedicated IP)
	GetVPSProxyInfo(context.Context, *connect.Request[v1.GetVPSProxyInfoRequest]) (*connect.Response[v1.GetVPSProxyInfoResponse], error)
	// Firewall management
	ListFirewallRules(context.Context, *connect.Request[v1.ListFirewallRulesRequest]) (*connect.Response[v1.ListFirewallRulesResponse], error)
	GetFirewallRule(context.Context, *connect.Request[v1.GetFirewallRuleRequest]) (*connect.Response[v1.GetFirewallRuleResponse], error)
	CreateFirewallRule(context.Context, *connect.Request[v1.CreateFirewallRuleRequest]) (*connect.Response[v1.CreateFirewallRuleResponse], error)
	UpdateFirewallRule(context.Context, *connect.Request[v1.UpdateFirewallRuleRequest]) (*connect.Response[v1.UpdateFirewallRuleResponse], error)
	DeleteFirewallRule(context.Context, *connect.Request[v1.DeleteFirewallRuleRequest]) (*connect.Response[v1.DeleteFirewallRuleResponse], error)
	GetFirewallOptions(context.Context, *connect.Request[v1.GetFirewallOptionsRequest]) (*connect.Response[v1.GetFirewallOptionsResponse], error)
	UpdateFirewallOptions(context.Context, *connect.Request[v1.UpdateFirewallOptionsRequest]) (*connect.Response[v1.UpdateFirewallOptionsResponse], error)
	// SSH key management
	ListSSHKeys(context.Context, *connect.Request[v1.ListSSHKeysRequest]) (*connect.Response[v1.ListSSHKeysResponse], error)
	AddSSHKey(context.Context, *connect.Request[v1.AddSSHKeyRequest]) (*connect.Response[v1.AddSSHKeyResponse], error)
	UpdateSSHKey(context.Context, *connect.Request[v1.UpdateSSHKeyRequest]) (*connect.Response[v1.UpdateSSHKeyResponse], error)
	RemoveSSHKey(context.Context, *connect.Request[v1.RemoveSSHKeyRequest]) (*connect.Response[v1.RemoveSSHKeyResponse], error)
	// Reset root password for a VPS instance
	// Password is generated and returned once, then discarded (never stored)
	ResetVPSPassword(context.Context, *connect.Request[v1.ResetVPSPasswordRequest]) (*connect.Response[v1.ResetVPSPasswordResponse], error)
	// Reinitialize a VPS instance
	// This will delete all data on the VPS and reinstall the operating system
	// The VPS will be reconfigured with the same cloud-init settings
	ReinitializeVPS(context.Context, *connect.Request[v1.ReinitializeVPSRequest]) (*connect.Response[v1.ReinitializeVPSResponse], error)
	// Stream VPS provisioning logs
	StreamVPSLogs(context.Context, *connect.Request[v1.StreamVPSLogsRequest], *connect.ServerStream[v1.VPSLogLine]) error
	// Import missing VPS instances from Proxmox that belong to the organization
	// This will scan Proxmox for VMs with Obiente Cloud descriptions and import
	// any that are missing from the database, ensuring they belong to the requesting organization
	ImportVPS(context.Context, *connect.Request[v1.ImportVPSRequest]) (*connect.Response[v1.ImportVPSResponse], error)
	// Get DHCP leases for VPS instances in an organization
	// Leases are stored in the database and synced from gateway nodes
	GetVPSLeases(context.Context, *connect.Request[v1.GetVPSLeasesRequest]) (*connect.Response[v1.GetVPSLeasesResponse], error)
	// Register a new DHCP lease (called by gateway nodes via persistent connection)
	RegisterLease(context.Context, *connect.Request[v1.RegisterLeaseRequest]) (*connect.Response[v1.RegisterLeaseResponse], error)
	// Release a DHCP lease (called by gateway nodes via persistent connection)
	ReleaseLease(context.Context, *connect.Request[v1.ReleaseLeaseRequest]) (*connect.Response[v1.ReleaseLeaseResponse], error)
}

